import React, { Component } from 'react'

import ReactPlayer from 'react-player';

export default class YoutubeFooter extends Component {

    state = {
        playing : false
    }

    render() {
        var {title, author, url} = this.props
        return (
            <div style = {{
                height: 200, 
                width: '100%', 
                backgroundColor: 'white', 
                position: 'fixed', 
                bottom: 0,
                display: 'flex',
                flexDirection: 'row'}}>

                <ReactPlayer 
                    url={url}
                    width = {200}
                    height = {200}
                    playing = {this.state.playing}
                    onReady = {() => console.log("Ready")}/>

                <div>
                    <h5>{title}</h5>
                    <h6>{author}</h6>
                </div>

                <i style = {{fontSize: 100}} class="material-icons">play_arrow</i>
                <svg className="umbrella" xmlns="http://www.w3.org/2000/svg" width="32" height="32" viewBox="0 0 32 32" aria-labelledby="title">
                    <title id="title">Umbrella Icon</title>
